import React, { useState, useEffect } from 'react';
import { userAPI } from '../services/api';
import { getUser } from '../services/auth';

const Profile = () => {
  const [userStats, setUserStats] = useState(null);
  const [attempts, setAttempts] = useState([]);
  const [userData, setUserData] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchUserData();
  }, []);

  const fetchUserData = async () => {
    try {
      // Get user info from local storage/auth
      const currentUser = getUser();
      setUserData(currentUser);

      // Fetch stats and attempts from API
      const [statsResponse, attemptsResponse] = await Promise.all([
        userAPI.getStats(),
        userAPI.getAttempts()
      ]);

      setUserStats(statsResponse.data);
      setAttempts(attemptsResponse.data.attempts || []);
    } catch (error) {
      console.error('Failed to fetch user data:', error);
    }
    setLoading(false);
  };

  if (loading) {
    return <div className="loading">Loading profile...</div>;
  }

  return (
    <div className="profile-page">
      <div className="profile-header">
        <h1>Your Profile</h1>
        <p>Track your progress and coding statistics</p>
      </div>

      {/* User Info Section with Avatar */}
      {userData && (
        <div className="user-info-section">
          <div className="user-profile-card">
            <div className="user-avatar-container">
              {userData.avatar ? (
                <img 
                  src={userData.avatar} 
                  alt={userData.name}
                  className="user-avatar-large"
                  onError={(e) => {
                    e.target.style.display = 'none';
                    e.target.nextSibling.style.display = 'block';
                  }}
                />
              ) : null}
              <div className="avatar-placeholder" style={{ display: userData.avatar ? 'none' : 'block' }}>
                {userData.name ? userData.name.charAt(0).toUpperCase() : 'U'}
              </div>
            </div>
            <div className="user-details">
              <h2>{userData.name || 'User'}</h2>
              <p className="user-email">{userData.email || 'No email available'}</p>
              <p className="member-since">
                Member since: {userData.createdAt ? new Date(userData.createdAt).toLocaleDateString() : 'N/A'}
              </p>
            </div>
          </div>
        </div>
      )}

      {userStats && (
        <div className="stats-section">
          <h2>Performance Statistics</h2>
          <div className="stats-grid">
            <div className="stat-card">
              <div className="stat-icon">üìä</div>
              <h3>Total Attempts</h3>
              <p className="stat-number">{userStats.stats?.totalAttempts || 0}</p>
            </div>
            <div className="stat-card">
              <div className="stat-icon">‚úÖ</div>
              <h3>Solved Problems</h3>
              <p className="stat-number">{userStats.stats?.solvedProblems || 0}</p>
            </div>
            <div className="stat-card">
              <div className="stat-icon">üìà</div>
              <h3>Success Rate</h3>
              <p className="stat-number">{userStats.stats?.successRate || 0}%</p>
            </div>
            <div className="stat-card">
              <div className="stat-icon">‚è±Ô∏è</div>
              <h3>Average Time</h3>
              <p className="stat-number">{userStats.stats?.avgTime || 0}m</p>
            </div>
          </div>

          {/* Top Tags */}
          {userStats.byTag && Object.keys(userStats.byTag).length > 0 && (
            <div className="top-tags-section">
              <h3>Performance by Tags</h3>
              <div className="tags-stats">
                {Object.entries(userStats.byTag)
                  .sort(([,a], [,b]) => b.attempted - a.attempted)
                  .slice(0, 6)
                  .map(([tag, data]) => (
                    <div key={tag} className="tag-stat-item">
                      <span className="tag-name">{tag}</span>
                      <span className="tag-numbers">
                        {data.solved}/{data.attempted} solved
                      </span>
                      <div className="tag-progress">
                        <div 
                          className="progress-bar"
                          style={{ 
                            width: `${data.attempted > 0 ? (data.solved / data.attempted) * 100 : 0}%` 
                          }}
                        ></div>
                      </div>
                    </div>
                  ))}
              </div>
            </div>
          )}
        </div>
      )}

      <div className="attempts-section">
        <h2>Recent Activity</h2>
        {attempts.length > 0 ? (
          <div className="attempts-list">
            {attempts.slice(0, 10).map(attempt => (
              <div key={attempt._id} className="attempt-card">
                <div className="attempt-header">
                  <h4>{attempt.problemName}</h4>
                  <span className={`status ${attempt.solved ? 'solved' : 'unsolved'}`}>
                    {attempt.solved ? '‚úÖ Solved' : '‚ùå Unsolved'}
                  </span>
                </div>
                <div className="attempt-details">
                  <span className="rating">Rating: {attempt.problemRating || 'N/A'}</span>
                  <span className="time">Time: {attempt.timeTaken || 'N/A'}m</span>
                  <span className="language">Language: {attempt.language || 'N/A'}</span>
                  <span className="date">
                    {new Date(attempt.attemptDate).toLocaleDateString()}
                  </span>
                </div>
                <div className="problem-tags">
                  {attempt.problemTags?.map(tag => (
                    <span key={tag} className="tag">{tag}</span>
                  ))}
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="no-attempts">
            <p>No attempts yet. Start solving problems to see your progress!</p>
            <a href="/" className="btn btn-primary">Start Solving</a>
          </div>
        )}
      </div>
    </div>
  );
};

export default Profile;
